import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import {
  AppBar,
  Box,
  Toolbar,
  IconButton,
  Typography,
  Button,
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Badge,
  useMediaQuery,
  useTheme,
} from '@mui/material';
import {
  Menu as MenuIcon,
  ShoppingCart as CartIcon,
  Home as HomeIcon,
  Category as ProductsIcon,
  Close as CloseIcon,
  Favorite as FavoriteIcon,
} from '@mui/icons-material';
import { useProduct } from '../context/ProductContext';

const Navbar = () => {
  const [mobileOpen, setMobileOpen] = useState(false);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));
  const navigate = useNavigate();
  const { getCartCount, wishlist } = useProduct();

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const menuItems = [
    { text: 'Home', icon: <HomeIcon />, path: '/' },
    { text: 'Products', icon: <ProductsIcon />, path: '/products' },
  ];

  const drawer = (
    <Box sx={{ width: 250 }}>
      <Box
        sx={{
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'space-between',
          p: 2,
        }}
      >
        <Typography variant="h6" sx={{ color: 'white' }}>
          Menu
        </Typography>
        <IconButton
          onClick={handleDrawerToggle}
          sx={{
            color: 'white',
            '&:hover': { color: '#7c4dff' },
          }}
        >
          <CloseIcon />
        </IconButton>
      </Box>
      <List>
        {menuItems.map((item) => (
          <ListItem
            button
            key={item.text}
            component={Link}
            to={item.path}
            onClick={handleDrawerToggle}
            sx={{
              '&:hover': {
                bgcolor: 'rgba(124,77,255,0.1)',
                '& .MuiListItemIcon-root': {
                  color: '#7c4dff',
                },
              },
            }}
          >
            <ListItemIcon sx={{ color: 'rgba(255,255,255,0.7)' }}>
              {item.icon}
            </ListItemIcon>
            <ListItemText
              primary={item.text}
              sx={{
                '& .MuiTypography-root': {
                  color: 'white',
                },
              }}
            />
          </ListItem>
        ))}
      </List>
    </Box>
  );

  return (
    <AppBar
      position="sticky"
      sx={{
        background: 'rgba(0,0,0,0.5)',
        backdropFilter: 'blur(10px)',
        borderBottom: '1px solid rgba(255,255,255,0.1)',
      }}
    >
      <Toolbar>
        {isMobile && (
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{
              mr: 2,
              '&:hover': {
                color: '#7c4dff',
              },
            }}
          >
            <MenuIcon />
          </IconButton>
        )}
        <Typography
          variant="h6"
          component={Link}
          to="/"
          sx={{
            flexGrow: 1,
            textDecoration: 'none',
            color: 'white',
            fontWeight: 700,
            letterSpacing: 1,
            '&:hover': {
              color: '#7c4dff',
            },
          }}
        >
          Cosmos Shop
        </Typography>
        {!isMobile && (
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
            {menuItems.map((item) => (
              <Button
                key={item.text}
                component={Link}
                to={item.path}
                startIcon={item.icon}
                sx={{
                  color: 'white',
                  '&:hover': {
                    color: '#7c4dff',
                  },
                }}
              >
                {item.text}
              </Button>
            ))}
          </Box>
        )}
        <IconButton
          color="inherit"
          onClick={() => navigate('/products')}
          sx={{
            ml: 2,
            '&:hover': {
              color: '#7c4dff',
            },
          }}
        >
          <Badge 
            badgeContent={wishlist.length} 
            color="error"
            sx={{
              '& .MuiBadge-badge': {
                bgcolor: '#ff3d47',
              },
            }}
          >
            <FavoriteIcon />
          </Badge>
        </IconButton>
        <IconButton
          color="inherit"
          onClick={() => navigate('/cart')}
          sx={{
            ml: 1,
            '&:hover': {
              color: '#7c4dff',
            },
          }}
        >
          <Badge 
            badgeContent={getCartCount()} 
            color="error"
            sx={{
              '& .MuiBadge-badge': {
                bgcolor: '#7c4dff',
              },
            }}
          >
            <CartIcon />
          </Badge>
        </IconButton>
      </Toolbar>
      <Drawer
        variant="temporary"
        anchor="left"
        open={mobileOpen}
        onClose={handleDrawerToggle}
        ModalProps={{
          keepMounted: true,
        }}
        PaperProps={{
          sx: {
            width: 250,
            bgcolor: 'rgba(0,0,0,0.9)',
            backdropFilter: 'blur(10px)',
          },
        }}
      >
        {drawer}
      </Drawer>
    </AppBar>
  );
};

export default Navbar;
